  handleRentSort(order: string) {
    this.rentSort = order;
    if(this.rentSort == "ascending"){
      this.filteredPosts.sort((a, b) => (
        a.rent > b.rent ? 1 : b.rent > a.rent ? -1 : 0));
    }

    if(this.rentSort == "descending"){
      this.filteredPosts.sort((a, b) => (
        b.rent > a.rent ? 1 : a.rent > b.rent ? -1 : 0));
    }
  }

  handleAreaSort(order: string) {
    this.areaSort = order;
    if(this.areaSort == "ascending"){
      this.filteredPosts.sort((a, b) => (
        a.area > b.area ? 1 : b.area > a.area ? -1 : 0));
    }

    if(this.areaSort == "descending"){
      this.filteredPosts.sort((a, b) => (
        b.area > a.area ? 1 : a.area > b.area ? -1 : 0));
    }
  }

  handleListingsFilterClick() {
    this.searchTerm="";
    if(this.selectedListingFilter === "Fav") {
      this.filteredPosts = this.posts.filter( (x: any) => x.favShow == true)
    }

    else if(this.selectedListingFilter === "Featured") {
      this.filteredPosts = this.posts.filter( (x: any) => x.featured == 'Yes')
    }

    else {
      
      this.filteredPosts = this.posts
    }

    
  }

